import React from "react";
import {
  FormControl,
  FormLabel,
  FormErrorMessage,
  FormHelperText,
  Input,
} from "@chakra-ui/react";

function InputFields() {
  return (
    <div className="flex flex-col mt-10 justify-center items-center">
      <h1 className="text-black text-xl font-semibold mb-8">
        {" "}
        Patient Information
      </h1>
      <div className="w-1/4">
        <FormControl my={10}>
          <div className="my-10">
            <FormLabel>Gender</FormLabel>
            <Input />
            <FormLabel>Birth Year</FormLabel>
            <Input />
            <FormLabel>Skin Tone</FormLabel>
            <Input />
            <FormLabel>Skin Conditions</FormLabel>
            <Input />
            <FormHelperText>Separate by ","</FormHelperText>
          </div>
        </FormControl>
      </div>
    </div>
  );
}

export default InputFields;
